// import logo from './logo.svg';
import './App.css';
// import mycs from './mycss.module.css'
// import './home.css'
import './css/all.min.css'
// const obj = {
//   color: "blue"
// }


function App() {
  return (
    // <div className="App">
    //   <div style={{color:"red"}}>Hello</div>
    //   <div style={obj}>good morning</div>
    //   <div class="demo">How are you?</div>
    //   <div class={mycs.test}>hello</div>
    //   <div class="abc"></div>
    //   <img src={require('./image/1.jpg')} class="img"></img>
    // <a href={require("./image/1.jpg")}className="hathi" target="_blank">Elephant img</a>

    // </div>





    // ----------------------------------------------cdmi.in----------------------------

    // ------------------------------------start header top---------------------------------------
    <>
      <section class="header_top">
        <div class="container">
          <div class="flex1">
            <div class="flex">
              <div class="flex">
                <i class="fa-solid fa-envelope"></i>
                <p class="padding">info@cdmi.in</p>
              </div>
              <div class="flex start">
                <i class="fa-solid fa-certificate"></i>
                <p class="padding">Verify Certificate</p>
              </div>
            </div>
            <div>
              <p>HAVE ANY QUESTION ? +91 90333 16003</p>
            </div>
            <div class="flex icon">
              <i class="fa-brands fa-facebook-f"></i>
              <i class="fa-brands fa-twitter"></i>
              <i class="fa-brands fa-google-plus-g"></i>
              <i class="fa-brands fa-linkedin"></i>
              <i class="fa-brands fa-instagram"></i>
              <i class="fa-brands fa-youtube"></i>
              <i class="fa-brands fa-whatsapp"></i>
            </div>
          </div>
        </div>
      </section>
      {/* ------------------------------------end header top--------------------------------------- */}
      {/* ------------------------------------start header bottom--------------------------------------- */}

      <section class="header_bottom">
        <div class="container flex1">
          <div>
            <img class="logo_dark" src="https://www.cdmi.in/assets/front/images/creative-logo-blue.svg" alt="Creative Design &amp; Multimedia Institute" title="Creative Design &amp; Multimedia Institute">
            </img>
          </div>
          <ul class="flex main">
            <li><a>HOME</a></li>
            <li><a>COURSES<i class="fa-solid fa-angle-down"></i></a></li>
            <li><a>COLLAGE COURSES</a></li>
            <li><a>ACTIVIES<i class="fa-solid fa-angle-down"></i></a>
                <ul class="sub">
                  <li><a>Gallery</a></li>
                  <li><a>Events</a></li>
                </ul>
            </li>
            <li><a>BLOG</a></li>
            <li><a>KNOWN US<i class="fa-solid fa-angle-down"></i></a>
            <ul class="sub">
              <li><a>About us</a></li>
              <li><a>Success stories</a></li>
              <li><a>Placemenet partner</a></li>
            </ul>
            </li>
            <li><a>GET IN TOUCH</a></li>
            <li><a>STUDENT ZONE<i class="fa-solid fa-angle-down"></i></a>
            <ul class="sub">
              <li><a>Student Login</a></li>
              <li><a>Showcase</a></li>
            </ul>
            </li>
          </ul>

        </div>

      </section>
      {/* ------------------------------------end header bottom--------------------------------------- */}


















    </>
  );
}

export default App;
